import React from 'react';
import Header from './header/header';
import FeaturedArticles from './featured/FeaturedArticles';
import ForYou from './home_page/grid/forYou/forYou';
import Latestgrid from './home_page/grid/latest/LatestGrid';
import LatestNews from './latest/LatestNews';
import Footer from './footer/Footer';
import './home.css'; // Main CSS file for the entire app
import AdBanner from './AdBanner/AdBanner';
import Navigation from './nav/Navigation';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { h } from 'react-router-dom';

const Home = () => {
  return (
    <div className="apps">
      <AdBanner />
      <Header />
      <Navigation />
      <div className="app">
      <main className="main-content">
        <div className='grid'>
        <FeaturedArticles />
        <ForYou />
        <Latestgrid />
        </div>
        <LatestNews />
        <div className='SecAds'>
        <AdBanner />
        </div>
        <LatestNews />
      </main>
      </div>
      <Footer />
    </div>
  );
};

export default Home;
